import React from 'react';
import { Layout } from '../componets/Layout';
import OnlySkill  from '../img/OnlySkill.png'


export const AboutPage = () =>{
  return(
    <Layout>
      <h1>Skills Front-End</h1>
      <img className='skillFront' src={OnlySkill} alt="skills" />
      <h1>Skills Soft</h1>
    </Layout>
  )
}
